%angular
<!-- External libraries -->
<script type="text/javascript" src="http://dygraphs.com/dygraph-combined.js"></script>
<script src="https://code.highcharts.com/highcharts.js"></script>
<script src="https://code.highcharts.com/modules/exporting.js"></script>
<script src="https://cdn.plot.ly/plotly-latest.min.js"></script>

<div id="dummy" vars="data1,data1Schema,data2,data2Schema"></div>
<script type="text/javascript">
  var div = $('#dummy');
  //Given an element in the note & list of values to fetch from Spark
  //window.angularVars.myVal will be current value of backend Spark val of same name
  function hoist(element, varNames){
    window.angularVars = {};
    var scope = angular.element(element.parent('.ng-scope')).scope().compiledScope;
    $.each(varNames, function(i, v){
      window[v+'-watcher'] = scope.$watch(v, function(newVal, oldVal){
        console.log('Setting ' + v + ' to:\n');
        console.log(newVal);
        window.angularVars[v] = newVal;
      });
    });
  }
  hoist(div, div.attr('vars').split(','));
</script>

%angular
<div id="chart2" style="min-width: 100%; height: 500px; margin: 0 auto" data="data2"></div>
<script type="text/javascript">
var div = $('#chart2');
var data = window.angularVars[div.attr('data')][0].values;
var schema = window.angularVars[div.attr('data')+'Schema'];

var series = [];
$.each(schema.fields, function(i, v){
  if (i > 0){
    series.push({
      name: v.name, type: 'spline', yAxis: 0,
      tooltip: { valueSuffix: ' %' },
      data: JSON.parse('['+data[i].split(',')+']')
    });
  }
});

series[series.length-1].dashStyle = 'dot';
series[series.length-1].yAxis = 1;
series[series.length-1].tooltip.valueSuffix = ' MB';

function adjustSeries(index, dot){
  series[index].dashStyle = dot;
  series[index].yAxis = 2;
  series[index].tooltip.valueSuffix = ' Hits';
}

adjustSeries(series.length - 2, 'longDash');
adjustSeries(series.length - 3, 'shortDash');
adjustSeries(series.length - 4, 'shortDash');

var xAxis = {categories: data[0].split(','), crosshair: true};

var yAxis1 = {
  labels: { format: '{value} %', style: { color: Highcharts.getOptions().colors[2] } },
  title: { text: 'Percentage Consumed', style: { color: Highcharts.getOptions().colors[2] } },
  opposite: true
};

var yAxis2 = {
  labels: { format: '{value} MB', style: { color: Highcharts.getOptions().colors[0] } },
  title: { text: 'Memory Available', style: { color: Highcharts.getOptions().colors[0] } },
  gridLineWidth: 0
};

var yAxis3 = {
  labels: { format: '{value}', style: { color: Highcharts.getOptions().colors[0] } },
  title: { text: 'App Events', style: { color: Highcharts.getOptions().colors[0] } },
  gridLineWidth: 0,
  opposite: true
};

var legend = {
  layout: 'vertical', align: 'left', verticalAlign: 'top', floating: true,
  backgroundColor: (Highcharts.theme && Highcharts.theme.legendBackgroundColor) || '#FFFFFF',
  x: 80, y: 55
};

$('#chart2').highcharts({
  chart: { zoomType: 'xy' },
  title: { text: 'Node Metrics:'},
  xAxis: [xAxis],
  yAxis: [yAxis1, yAxis2, yAxis3],
  series: series,
  legend: legend,
  tooltip: { shared: true }
});
</script>

%angular
<div id="chart1" title="Node Metrics" data="data1" yAxes="MemAvail,Percentage Consumed,HTTP Requests" height="400px" width="2000"></div>
<input id="x0" type="text" ng-model="x0" class="hide"></input>
<input id="x1" type="text" ng-model="x1" class="hide"></input>
<script type="text/javascript">
var div = $('#chart1');
var data = window.angularVars[div.attr('data')];
var schema = window.angularVars[div.attr('data')+'Schema'];

//Convert query results into Plotly traces: https://plot.ly/javascript/multiple-axes/#multiple-yaxes
var traces = [];
$.each(schema.fields.slice(1), function(i, field){ //Setup trace metadata
  var trace = {x: [], y: [], name: field.name, type: 'scatter', yaxis: 'y'};
  if (field.name.toLowerCase().indexOf('used') > 0) trace.yaxis = 'y2';
  else if (field.name.toLowerCase().indexOf('requests') > 0) trace.yaxis = 'y3';
  traces.push(trace);
});
//Load query results into trace arrays
$.each(data, function(i,row){
  //First value is a date
  var date = new Date(row.values[0]);
  $.each(row.values.slice(1), function(v, cell){
    traces[v].x.push(date);
    traces[v].y.push(cell);
  });
});

var layout = { title: 'MultiHost App View', legend: {orientation: 'h'}};
$.each(div.attr('yAxes').split(','), function(i, v){
  var axis = {title: v};
  var key = 'yaxis';
  if (i > 0){
    key += i+1;
    axis.side = 'right';
    axis.overlaying = 'y';
    axis.position = 1-.04*(i-1);
  }
  layout[key] = axis;
});

var config = {displaylogo: div.attr('showLinks'), showLinks: div.attr('showLinks'), modeBarButtonsToRemove: ['sendDataToCloud']};
Plotly.newPlot('chart1', traces, layout, config);
debugger;

div.bind('plotly_relayout', function(event,eventdata){
  alert(new Date(eventdata['xaxis.range[0]']) + '\n' + new Date(eventdata['xaxis.range[1]']));
  /*
  $('#x0').val(new Date(eventdata['xaxis.range[0]']));
  $('#x1').val(new Date(eventdata['xaxis.range[1]']));
  $('#x0').trigger('input');
  $('#x1').trigger('input');
  */
});
</script>
